import { Component } from '@angular/core';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css'],
})
export class LoginComponent {
  model = {
    email: '',
    password: '',
  };
}
<form class="row">
  <div class="col-6">
    <input
      type="email"
      class="form-control"
      placeholder="email"
      name="email"
      #email="ngModel"
      [(ngModel)]="model.email"
    />
  </div>
</form>
